INSERT INTO `wp_postmeta` VALUES (701,92,'jobs_0_description','<ul>\r\n 	<li><strong>Designed</strong> and <strong>consulted</strong> websites, landing pages and microsites for 200+ B2B and B2C companies using strategies that reflect the end goals.</li>\r\n 	<li><strong>Communicated</strong> ideas using sitemaps, wireframes, stylescapes and prototypes to clients, the SEO team and the web development team.</li>\r\n 	<li><strong>Developed</strong> websites independently or with a team using HTML, SCSS, PHP, Bootstrap, Javascript and jQuery in WordPress.</li>\r\n 	<li><strong>Organized</strong> a pricing structure and design process for logos to create additional revenue as well as expand the company’s portfolio and services.</li>\r\n 	<li><strong>Mentored</strong> peers to better understand their abilities, strengthen their talents and maximize their potential to the fullest.</li>\r\n 	<li><strong>Revised</strong> QA system to better define an error by orderly narrowing down the browser, operating system, platform, and page of the problem’s origin.</li>\r\n 	<li><strong>Spearheaded</strong> and <strong>executed</strong> a limit on revisions to prevent exhausting budgets through seemingly endless edits and encourage decisive decision-making.</li>\r\n</ul>');
