INSERT INTO `wp_postmeta` VALUES (9624,208,'about_content','<h3>Currently, I’m a senior web designer living and working near “Charm City” itself, Baltimore, MD.</h3>\r\n<span data-preserver-spaces=\"true\">I spend my days crafting asymmetrical, yet compelling </span><a class=\"_e75a791d-denali-editor-page-rtfLink\" href=\"/projects/\" target=\"_blank\" rel=\"noopener\"><span data-preserver-spaces=\"true\">websites</span></a><span data-preserver-spaces=\"true\"> through thoughtful strategy and execution.</span>\r\n\r\n<span data-preserver-spaces=\"true\">I led design at companies of various stages, taking a seed-stage esports startup from start to finish at Blitz to designing the next generation desktop client at Box.</span>\r\n\r\n<span data-preserver-spaces=\"true\">Aside from designing, I’m a hardcore gamer, die-hard metalhead, an aspiring composer, low-key health fanatic, and moonlight as a junior </span><a class=\"_e75a791d-denali-editor-page-rtfLink\" href=\"https://github.com/jatyburski\" target=\"_blank\" rel=\"noopener\"><span data-preserver-spaces=\"true\">front-end developer</span></a><span data-preserver-spaces=\"true\">.</span>');
