INSERT INTO `wp_postmeta` VALUES (11758,225,'intro','Mountainview Recovery is a rehabilitation center offering treatment in a family-like structure to those struggling with drug and alcohol abuse. Aiming to see each patient reach their fullest potential, they\'ve helped hundreds of individuals from the greater North Carolina region in which they reside.\r\n\r\nMountainview struggled with communication. It wasn\'t a fault in their mannerism, but rather a misdirection with their website. It lacked an overarching story that could resonate with its audience. Their story existed, but it needed an outlet. With the web content specialist and SEO strategist, together, we took a holistic approach to shape that story.');
