INSERT INTO `wp_postmeta` VALUES (11799,227,'intro','Founded in 1994 by Dr. Andrew Riemer, D.O., Riemer Eye Center provides a range of comprehensive eye care services for children and adults throughout Northern Michigan so that patients receive the best eye care available close to home. In addition to medical and surgical eye care, they offer the area’s largest selection of designer eyewear and contact lenses.\r\n\r\nOriginally, I participated in pitching the proposal to the client. And while, in the end, we ultimately didn\'t make the sale—due to what we concluded as a budgetary issue—I still held a strong interest in seeing the idea I had come to fruition.');
