INSERT INTO `wp_postmeta` VALUES (13034,47,'intro','<div class=\"o-header-block || c-project_intro_item -text -about js-animate is-show\">\r\n<p class=\"u-anim -parent -delay-4\">USA Bridal is a bridal superstore with 30 years of experience at providing over a thousand bridal and destination gowns from the world\'s best formal designers.</p>\r\n<p class=\"u-anim -parent -delay-4\">This concept was born from the dissatisfaction I had with what went public. It would have been easy to feel defeated, but instead, I chose to shift that energy into something creative. Although unused, this concept allowed me to rethink ideas and utilize insight embellished by self-criticism.</p>\r\n\r\n</div>');
