INSERT INTO `wp_postmeta` VALUES (13062,224,'intro','Established in 1845 by the Republic of Texas, the Galveston Regional Chamber of Commerce serves as Texas’ oldest chamber while championing over 750 small businesses, educational, research and healthcare facilities, government entities, and more.\r\n\r\nGalveston Chamber was looking to change its way of doing business through its website. They sought after higher conversation rates, increased revenue, simplified processes, a centralized platform, promotions, and an evaluation in their brand presence. Despite the massive undertaking this website portrayed, the team and I worked very closely with Galveston for over a year to accomplish these endeavors.');
