INSERT INTO `wp_postmeta` VALUES (13092,284,'goals','<h2 data-aos=\"fade-up\">Goals &amp; Ambitions</h2>\r\n<ul class=\"p-0 m-0\">\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Mature as an Effective Communicator</h3>\r\nBuild confidence in front of small audiences and, over time, larger groups.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Increase Self-Efficiency</h3>\r\nContinuously create coherent design systems, better understand the limitations of my bandwidth.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Embody Thought Leadership</h3>\r\nUnderstand my peers surrounding me and provide insight to those who seek it.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Network Within Communities</h3>\r\nAttend seminars and conferences that cover topics of interest with like-minded people and engage with them.</li>\r\n</ul>');
