INSERT INTO `wp_postmeta` VALUES (13324,228,'intro','TEC (Telecommunications Education Center), developed by the Wireless Infrastructure Association (WIA) alongside contributions from academia, subject matter experts, and WIA members, partners with businesses to meet training, education, and professional development needs through online courses.\r\n\r\nTEC formerly housed all information, including the ability to purchase courses, under one site. However, their core audience found this difficult to navigate. TEC opted to split and serve its courses through a system called Absorb leaving the website strictly informational. With a majority of the website offloaded, it became quite barren. This alerted TEC that things weren\'t quite finished, and a revaluation of the design was in order.');
