INSERT INTO `wp_postmeta` VALUES (13336,229,'intro','The Oniru Group offers HR management solutions, strategies, and methodologies that empower people to be their best selves in the workplace through HR consulting services, including diversity and inclusion, talent acquisition, employee separations, performance management, organizational, and leadership development.\r\n\r\nAs a rising startup, The Oniru Group had yet to establish a web presence for themselves. Their customer base existed solely through connections the founders made from years of experience in the industry. While these connections led to returning customers, The Oniru Group felt it was time to invest in attracting new business.');
