INSERT INTO `wp_postmeta` VALUES (13350,230,'intro','Array Dental Group is a business management firm—strictly for the dental industry—that helps its affiliates with business strategy and integration, tailored marketing and advertising, human resource management, and the optimization of operations across the Mid-Atlantic region.\r\n\r\nAn ambitious start-up on the rise, Array Dental was in search of abstract thinking to represent its image. They felt triumphant in that search with their logo and looked towards the team and I to keep that momentum going with establishing their web presence.');
