INSERT INTO `wp_postmeta` VALUES (14580,298,'about_content','<h3>Currently, I’m a <a title=\"Home\" href=\"/\">senior web designer based near “Charm City” itself, Baltimore, MD</a>.</h3>\r\nI specialize in helping your clients solve pivotal problems by crafting <a href=\"/projects/\">compelling, asymmetrical websites</a> through thoughtful strategy and meticulous execution. In a past life, still relating to design, I created dozens of direct mailers, brand collateral, signage, and more that has reached thousands of potential customers.\r\n\r\nAside from designing, I’m a hardcore gamer, die-hard metalhead, an aspiring composer, low-key health fanatic, and moonlight as a <a href=\"https://github.com/jatyburski\" target=\"_blank\" rel=\"nofollow noopener\">junior front-end developer</a>.');
