INSERT INTO `wp_postmeta` VALUES (15450,306,'testimonials_1_quote','Bryan, Katrina, and Joe are the dream team of a website redesign, in my opinion. They worked with me on website redesigns for two companies where I manage the marketing. The first redesign went so well, and the finished product was so beautiful and effective that I decided to do a second redesign with them. I have worked with several other web development companies in the past, and they do not even begin to compare to Compulse. Any questions, concerns, or issues that came up during the redesign process were taken care of quickly and effectively. I am absolutely thrilled with my new websites, from the design to the functionality. I would highly recommend this team.');
