INSERT INTO `wp_postmeta` VALUES (18920,47,'section_4_images_w_caption_caption','<h3>Contempo Rebranding</h3>\r\nUSA Bridal\'s brand identity, while compelling in theory, appeared antiquated by its typographic choices and clip art like iconography. With no-holds-barred, I decided to reimagine this idea.\r\n\r\nIn line with the original vision, all elements remained in the same position. <strong>Focus went more towards adjusting the typography and the icon.</strong> The <strong>rotation of the icon allows it to rest naturally</strong> within the brand name. This removes the awkward nature of bastardizing the icon enforcing it to fit. The sudden <strong>change in height helps create a visual breakage</strong> giving the identity a unique shape. And, the shift <strong>color tones align more with industry expectations</strong> and a stronger attraction to their demographic.');
