INSERT INTO `wp_postmeta` VALUES (19234,346,'about_content','<h3>Currently, I’m a senior web designer based near “Charm City” itself, Baltimore, MD.</h3>\r\nI specialize in helping your clients solve pivotal problems by crafting <a title=\"Projects\" href=\"/projects/\">compelling, asymmetric websites</a> through thoughtful strategy and meticulous execution. In a past life, pertaining to design, I created dozens of direct mailers, brand collateral, newsletters, and much more that has reached thousands of potential customers.\r\n\r\nAside from being a designer, I’m a hardcore gamer, die-hard metalhead, an aspiring composer, low-key health fanatic, fascinated by astrology and geography, and moonlight as a <a title=\"Github\" href=\"https://github.com/jatyburski\" target=\"_blank\" rel=\"nofollow noopener\">junior front-end developer</a>.');
