INSERT INTO `wp_postmeta` VALUES (19406,225,'section_1_blurb','<h2>Revamping the Chromaticity</h2>\r\nColors speak as loud as words. <strong>Mountainview\'s prior palette bestowed a dated, dreary demeanor</strong> embodied by its muted tones. It produced an egregious feeling causing both users, including its owners, to be turned off from the website.\r\n\r\nTo forge an enticing atmosphere encouraging users to seek help, <strong>I reevaluated existing hues to shift them more towards vibrant tones.</strong> In a side-by-side comparison, <strong>users felt more confident and at ease with the brighter and bolder tones</strong> versus the initial palette.');
