INSERT INTO `wp_postmeta` VALUES (20110,352,'goals','<h3 data-aos=\"fade-up\">Endeavors &amp; Acknowledg&shy;ments</h3>\r\n<ul class=\"p-0 m-0\">\r\n 	<li data-aos=\"fade-up\">\r\n<h4>Mature as a Robust Communicator</h4>\r\nStrengthen my confidence with small audiences and, over time, larger groups.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h4>Seek Discomfort</h4>\r\nThrive in sought-after challenges that stretch outside my expertise.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h4>Embody Thought Leadership</h4>\r\nUnderstand my peers surrounding me and cultivate those with insight who seek it.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h4>Network Within Communities</h4>\r\nAttend seminars and conferences covering topics of interest with like-minded people and engage with them.</li>\r\n</ul>');
