INSERT INTO `wp_postmeta` VALUES (20229,226,'intro','For over 40 years, Central Georgia Cancer Care (CGCC), as a diagnosis and treatment center, has been improving health outcomes to patients suffering from cancer or blood disorders.\r\n\r\nCGCC was looking to cross the finish line, which, unfortunately, never happened with their previous website. Their web presence existed, but it felt unfinished and hindered by instability, hierarchical challenges, and template limitations. These complications became the motivation between both parties to see this website reborn.');
