INSERT INTO `wp_postmeta` VALUES (20270,225,'section_3_blurb','<h2>The Road to Recovery</h2>\r\nContent is intrinsic to a website\'s success. A strong narrative can sell an intriguing, relatable story to the user. But, for it to be effectively consumed, the content must be lucid. My focus was to undertake that challenge.\r\n\r\nI started by <strong>creating a layout in a coherent pattern spiraling downward</strong> on the page. This helped users with the natural flow of progression and surveying they subconsciously partake in. <strong>I emphasized keywords</strong> in the form of a change in their weight to accomplish the following: <strong>for search bots to recognize these words carry more importance and users to scan more efficiently and accurately.</strong> And, while the web content specialist was ultimately responsible for the content of the website, <strong>I also contributed with microcopy</strong> wherever it would fit best.\r\n\r\n&nbsp;');
INSERT INTO `wp_postmeta` VALUES (20271,225,'_section_3_blurb','field_5efd211f1626a');
