INSERT INTO `wp_postmeta` VALUES (20353,225,'section_8_blurb','<h2>Education First and Foremost</h2>\r\nWhile drug and alcohol addiction has plagued America for years, it still isn\'t a topic well-understood by a majority of people. Mountainview was looking to change this perspective. To accomplish this, the team and I <strong>designed a comprehensive library of addictions and treatments</strong> and cataloged them in an easy-to-find format. Additionally, we <strong>established a fully-functional blogging system</strong> that encapsulated Mountainview\'s internal discussions with its patients and redirected them towards the general public.');
