INSERT INTO `wp_postmeta` VALUES (20759,357,'about_content','<h3>Currently, I’m a senior web designer based near “Charm City” itself, Baltimore, MD.</h3>\r\nI specialize in <strong>helping your clients solve pivotal problems</strong> by crafting <a title=\"Projects\" href=\"/projects/\">compelling, asymmetric websites</a> through <strong>thoughtful strategy and meticulous execution.</strong> For the past eight years, I have <strong>worked with or for large companies to rising startups</strong>—coast to coast—as a designer either <strong>solo or on a team</strong>.\r\n\r\nAside from being a designer, I’m a hardcore gamer, die-hard metalhead, an aspiring composer, low-key health fanatic, fascinated by astrology and geography, and moonlight as a <a title=\"Github\" href=\"https://github.com/jatyburski\" target=\"_blank\" rel=\"nofollow noopener\">junior front-end developer</a>.');
