INSERT INTO `wp_postmeta` VALUES (21089,226,'section_1_blurb','<h2>Standardizing An Identity</h2>\r\nCGCC\'s brand identity is a beautiful combination of serenity and fellowship. And while proudly displayed within the logo, it was deemed missing from their web presence. Seeing the potential there, I worked towards a solution to help create a welcoming atmosphere.\r\n\r\nTo start, CGCC\'s color spectrum—ranging from hot to cold tones—tallies upwards of seven with six used in their logo alone. To <strong>emphasize the feeling of serenity and provide a purpose to each color</strong>, I opted to have cooler tones act as the primary hues. Following tones, such as red and yellow, were utilized to prioritize the significance of specified elements, and the greys and dark blue brought support to the content.\r\n\r\nOnce a year, CGCC would invest in a photographer to document changes—staff, departments, the building, etc—around the facility. It was perfect timing that this was happening again amidst of their website redesign. Establishing a pretty good relationship by this point gave them the <strong>confidence to consider my opinion in the art direction of the imagery</strong>. My direction, alongside with the photographer\'s skill set, created a noticeable sense of friendliness that tied together with their branding.');
INSERT INTO `wp_postmeta` VALUES (21090,226,'_section_1_blurb','field_5efd211f1626a');
