INSERT INTO `wp_postmeta` VALUES (21101,229,'section_1_blurb','<h2>Empowering the Brand</h2>\r\nThe leaders of The Oniru Group always focused on empowering people to perform better. And now that they\'re business was finally up and running, it was time to return the favor.\r\n\r\nThe first step was getting people familiar with them. The steps I took—<strong>stating the value proposition in the form of call-to-actions, benefits, and features, creating persona-focused design and copy, minimizing the navigation to its essentials and linking to the most sought after content</strong>—were all inspired by the anatomy of a great homepage. <strong>Narrowing down their color scheme from seven shades of blue to three</strong> contrasted elements better against one another and became simpler for users to coordinate with. And, the <strong>white space established a sense of an open environment</strong> where users can feel comfortable.');
INSERT INTO `wp_postmeta` VALUES (21102,229,'_section_1_blurb','field_5efd211f1626a');
