INSERT INTO `wp_postmeta` VALUES (21117,226,'section_3_blurb','<h2>Rebranded as an Expert</h2>\r\nWhen it comes to healthcare, users are often quick to Google their questions. The results predetermine a provider\'s level of expertise to the user. The content on CGCC\'s previous website failed to target user queries causing search engines not to recognize them as an expert. The team and I made it our mission to correct this.\r\n\r\nWe started by infixing questions into section headers resembling what users may search for. Next, we examined their current audience and found that roughly <strong>90% arrive as patient referrals from primary care physicians</strong>. Because they\'ve already transitioned into becoming a patient, it would be counter-intuitive to target this audience. So instead, we opted for the remainder—<strong>users looking for a second opinion</strong>. Because of this, we dedicated <strong>pages describing in detail what a second opinion is, how it works, and what a user can do to get one</strong>. Call-to-actions, highlighted of cardinal significance, were incorporated throughout the site encouraging more traffic to those pages. It also stands as one of the premier interactions above the fold on the home page.');
INSERT INTO `wp_postmeta` VALUES (21118,226,'_section_3_blurb','field_5efd211f1626a');
