INSERT INTO `wp_postmeta` VALUES (21147,226,'section_7_blurb','<h2>Patient-First Approach</h2>\r\nAs previously mentioned, CGCC\'s core audience is patient referrals. Because it\'s the preeminent transaction for the company, this market will always reign dominant. Knowing this, I took <strong>great care into making a patient\'s experience as streamline as possible.</strong>\r\n\r\nTo streamline their experience, I investigated the repeating reasons for returning to the website. I discovered that these users\' interests resided in either paying their bills or logging into the patient portal. To provide the quickest access, <strong>links to each of those sections were embedded at the top of the page—differentiated by color.</strong>');
INSERT INTO `wp_postmeta` VALUES (21148,226,'_section_7_blurb','field_5efd211f1626a');
