INSERT INTO `wp_postmeta` VALUES (21161,229,'section_3_blurb','<h2>Polar Opposites</h2>\r\nThe Oniru Group operates two services—human resources and office space rentals—conterminous within their business. But, because of their differences, having just one website would suffocate their chances at ranking due to unfocused content. To up the ante, The Oniru Group wasn\'t interested in paying for two sites. This left the team and I with the challenge of creating separation within scope.\r\n\r\n<strong>Our solution was to create a subdomain to house all information regarding their secondary service.</strong> This would allow <strong>each service to rank individually instead of competitively, </strong>including carrying over the styles from the primary website. We <strong>ultimately opted for space rentals as the secondary</strong> because the main field of study both founders excelled at was human resources.');
