INSERT INTO `wp_postmeta` VALUES (21199,228,'section_1_blurb','<h2>Advancing Careers</h2>\r\nTEC\'s <strong>initial design struggled with bearing semblance towards being an online educational facility</strong>. It instead mirrored its parent organization, highlighting services and announcements within the industry. This failed in explaining to users what TEC can do for them and perhaps was a factor in the confusion they experienced. To solve this, I began researching to devise a better solution.\r\n\r\nI <strong>took inspiration from some of the highest performing online course websites today to reimagine the informational architecture</strong> of TEC. I began to notice these industry leaders followed a systemic formula emphasizing the following: <strong>courses and a systematic catalog, benefits intertwined with features, <a href=\"#accessible-resources\">accessible resources</a>, the ability to ask and search questions, a list of upcoming events held by that company, and making a spectacle of testimonials and partners</strong>. Each of these was reflected in TEC\'s redesign.');
INSERT INTO `wp_postmeta` VALUES (21200,228,'_section_1_blurb','field_5efd211f1626a');
