INSERT INTO `wp_postmeta` VALUES (21205,228,'section_2_images_w_caption_caption','<h3>Finding the Right Course</h3>\r\nOnline courses are the lifeblood of TEC. Being regularly visited, I made sure to include several call-to-actions and links to this section for users to easily navigate to. Upon reaching the page, users are presented with a <strong>multitude of options ranging from category and course selection to filtering by specific needs</strong>. Once a course is clicked on, a detailed page displays an abundance of information related to that course helping to finalize the user\'s purchasing decision. If the user decides to enroll, <strong>all purchases are then redirected towards the Absorb platform</strong>.');
