INSERT INTO `wp_postmeta` VALUES (21227,228,'section_6_blurb','<h2>Accessible Resources</h2>\r\nResources are an integral part of the learning process. TEC made sure to have this be available on their site, however, it never exceeded beyond a simple dossier or an external third-party redirect. For this to be worthwhile for their students, they needed to supply more than the bare minimum.\r\n\r\nResources did not require much change in its content. Instead, <strong>I focused on a better organization</strong> that results in less scrolling for the user. The events page, however, received an overhaul resulting in <strong>a filtration system for attendees to find their interests, a detailed page offering fine points of the event, and an external link to register.</strong> The most noticeable advancement was the <strong>introduction of a frequently asked questions page</strong>. This opened the floor to quickly answer a current or potential student\'s question without invoking their effort to contacting TEC. Of course, if their question remained unanswered, options were available for them to reach out for help.');
INSERT INTO `wp_postmeta` VALUES (21228,228,'_section_6_blurb','field_5efd211f1626a');
