INSERT INTO `wp_postmeta` VALUES (21243,230,'section_1_blurb','<h2>Defining Dental Support</h2>\r\nThe client and I were spellbound with abstract features representing Array Dental\'s image and values. However, considering the esoteric nature of this subject matter, we needed to be careful not to let our fascination digress from distinctly defining a dental support organization.\r\n\r\n<strong>Throughout the initial prototypes, these abstract ideas were explored</strong>. And while they were tangential on defining the business, internal user testing proved it remained unclear to a less informed audience. Though the testers did not mirror their current audience of dentists with 20+ years of experience on the verge of retirement, their impressions did provide insight into how a younger, less experienced dentist, who would be more sustainable for Array Dental, may react.\r\n\r\nWith this knowledge, I made a case to the client to include more relatable elements into the design. The addition of <strong>dentists, business people, and meetings through imagery, along with embedding common keywords into the context, created a more transparent connection for users</strong> to establish with Array Dental\'s services.');
INSERT INTO `wp_postmeta` VALUES (21244,230,'_section_1_blurb','field_5efd211f1626a');
