INSERT INTO `wp_postmeta` VALUES (21299,227,'section_1_blurb','<h2>Contemporary Vision</h2>\r\nDuring the pitch, Riemer expressed interest proceeding forward with a modern take of their brand. While their audience remained loyal throughout the years, they needed to attract a younger crowd to have a future. Riemer was kind enough to supply a working example of their expectations. And this ultimately became my guiding light.\r\n\r\n<strong>Strong imagery was important to Riemer.</strong> The examples they provided showcased a simple approach—a person with glasses overlaying a colored background. I applied this same <strong>technique using colors that contrasted well against the purple, blue, and green palette</strong>. To evoke a sense of sleek and modern, I created a trendy <strong>collage of patterns and shapes overlapping</strong> one another. This created a bit of an <strong>optical illusion giving the site depth</strong>. And finally, I invested in a <strong>typeface that displayed itself as bold, simplistic, and elegant</strong> to mirror the fashion decisions a younger crowd might make.');
INSERT INTO `wp_postmeta` VALUES (21300,227,'_section_1_blurb','field_5efd211f1626a');
