INSERT INTO `wp_postmeta` VALUES (21891,226,'section_8_images_w_caption_caption','<h3>A Progressive Navigation</h3>\r\nChild pages baring multiple siblings typically activate a <strong>progressively collapsing navigation</strong>. Much like the <a title=\"Telecomm. Education Center\" href=\"/projects/telecommunications-education-center/\">Telecommunication Education Center website</a>, this navigational type <strong>allows the menu to fit any size screen, device, or resolution</strong> by shifting overflowing links into a dropdown. To test its accessibility, <strong>I ran several internal user tests on participants varying in technical expertise.</strong> I found that nine out of 10 times users not only instinctively knew how to engage but also preferred it over the primary navigation when traversing related pages.');
INSERT INTO `wp_postmeta` VALUES (21892,226,'_section_8_images_w_caption_caption','field_5efd33ea59cd0');
INSERT INTO `wp_postmeta` VALUES (21893,226,'section_8_images_w_caption','');
INSERT INTO `wp_postmeta` VALUES (21894,226,'_section_8_images_w_caption','field_5efd33d559cce');
