INSERT INTO `wp_postmeta` VALUES (21901,228,'section_7_images_w_caption_caption','<h3>Progressive Navigation</h3>\r\nChild pages baring multiple siblings typically activate a <strong>progressively collapsing navigation</strong>. Much like the <a title=\"Central Georgia Cancer Care\" href=\"/projects/central-georgia-cancer-care/\">Central Georgia Cancer Care website</a>, this navigational type <strong>allows the menu to fit any size screen, device, or resolution</strong> by shifting overflowing links into a dropdown. To test its accessibility, <strong>I ran several internal user tests on participants varying in technical expertise.</strong> I found that nine out of 10 times users not only instinctively knew how to engage but also preferred it over the primary navigation when traversing related pages.');
INSERT INTO `wp_postmeta` VALUES (21902,228,'_section_7_images_w_caption_caption','field_5efd33ea59cd0');
INSERT INTO `wp_postmeta` VALUES (21903,228,'section_7_images_w_caption','');
INSERT INTO `wp_postmeta` VALUES (21904,228,'_section_7_images_w_caption','field_5efd33d559cce');
INSERT INTO `wp_postmeta` VALUES (21911,227,'section_3_blurb','<h2>Framing a Subscriber Base</h2>\r\nVision insurance is crucial nowadays for eyesight. For those who couldn\'t afford it, Riemer crafted together a free program called RiemerRewards. It helps customers save upwards of 25% on prescription frames or lenses, encouraging them to fulfill their eye care needs with Riemer solely. It was imperative this customer-friendly business model captivated that audience.\r\n\r\nI dedicated the hero on the home page to this and <strong>carefully focused on a phrase that users would care most for</strong>. I included <strong>additional call-to-actions scattered throughout the website</strong> to remind users of the initial benefit or expand upon with further insight. Each of these <strong>leads to a page detailing the expectations and allows users to kickstart their journey</strong> from the comfort of home.');
INSERT INTO `wp_postmeta` VALUES (21912,227,'_section_3_blurb','field_5efd211f1626a');
