INSERT INTO `wp_postmeta` VALUES (21920,227,'_section_4_images_w_caption','field_5efd33d559cce');
INSERT INTO `wp_postmeta` VALUES (21921,227,'section_5_blurb','<h2>Eye on the Prize</h2>\r\nRiemer\'s sales happen 100% on-campus. With their website, they desired the ability to provide the go-to resource for information regarding eye care, their services, and doctors. Still, they ultimately looked to inspire potential customers into choosing them. The most viable way appeared to be making Riemer the most accessible. This was the challenge I embraced.\r\n\r\nI <strong>categorized each service, doctor, and resource into an easy-to-follow format</strong> through not only the primary navigation but also the footer. Quick <strong>links outside the menu provide highly-valued options for users</strong> who may come back for repeat visits. And, I included contact information for each doctor on their respective page.');
INSERT INTO `wp_postmeta` VALUES (21922,227,'_section_5_blurb','field_5efd211f1626a');
