INSERT INTO `wp_postmeta` VALUES (21989,224,'section_1_blurb','<h2>Screen Agnosticism</h2>\r\nGalveston\'s previous website suffered from being an unfriendly environment when it came to mobile platforms. It simply was not responsive which damaged their online presence. They would rank poorly through search engines, and their on-the-go customer base was forced to do everything by desktop. It was my mission to unshackle these restraints that no website today should have.\r\n\r\nMaking this responsive, I made sure <strong>the experience remained in tack while only stripping away elements that were not of necessity</strong>. Things like the <strong>breadcrumbs were simplified</strong> to provide only a way back instead of the entire chain leading to that point to fit better within the restricted space. <strong>Carousels were morphed to create a peeking effect from the edge of the browser window</strong> to encourage scroll interaction. And finally, navigational items were repositioned to be <strong>more accessible by a user\'s thumb</strong>.');
INSERT INTO `wp_postmeta` VALUES (21990,224,'_section_1_blurb','field_5efd211f1626a');
