INSERT INTO `wp_postmeta` VALUES (22020,224,'_section_2_images_w_caption_gallery','field_5efd33e259ccf');
INSERT INTO `wp_postmeta` VALUES (22021,224,'section_2_images_w_caption_caption','<h3>Thumb-Driven Design</h3>\r\nAs previously mentioned above, <strong>placing elements within thumb\'s reach was a driving factor for this design</strong>. And the navigation itself plays a significant role in that concept.\r\n\r\nReading an <a href=\"https://www.smashingmagazine.com/2016/09/the-thumb-zone-designing-for-mobile-users/\" target=\"_blank\" rel=\"nofollow noopener\">article</a> about mobile design got me thinking more about the user\'s experience on these platforms. Doing so had me decide to opt away from traditional designs in favor of one that all users, <strong>regardless of their choice in how they hold their device</strong>, could easily interact with. This resulted in the placement of the navigation towards the bottom of the screen.');
INSERT INTO `wp_postmeta` VALUES (22022,224,'_section_2_images_w_caption_caption','field_5efd33ea59cd0');
