INSERT INTO `wp_postmeta` VALUES (22031,224,'section_4_blurb','<h2>Promote and Advocate for Memberships</h2>\r\nFor Galveston Chamber to be able to invest in the business community, it needs the community to invest in them. But this wasn\'t easy for the community to do. The registration process wasn\'t electronic and required mail-ins to complete. They may be the oldest chamber in Texas, but there was no reason their process for joining had to be anymore.\r\n\r\nThe fundamental method of attracting a user\'s attention, <strong>call-to-actions, was the first step I took</strong> towards getting Galveston on the right track. These were included within the main navigation as well as embedded within content as its own section, but <strong>no further down then 60% of the page\'s total length</strong> for the best probability of being noticed. All <strong>call-to-actions are forwarded to a registration page</strong> hosted by Chamber Master, a CMS specifically developed for a chamber of commerce, for any business to sign up at any time. For those seeking information before committing, a copious library of events, tiers, benefits, programs, and more is accessible to all users.');
INSERT INTO `wp_postmeta` VALUES (22032,224,'_section_4_blurb','field_5efd211f1626a');
