INSERT INTO `wp_postmeta` VALUES (22039,224,'section_6_blurb','<h2>Converging Platforms</h2>\r\nGalveston Chamber utilized Chamber Master to regulate their content. Years of practice made them comfortable with its system, and they were seeking to preserve that. Though this was a problem for the development team to solve, I still worked closely throughout the process to learn of the limitations that may affect the design.\r\n\r\nThe developers\' research found that there was ultimately no concerns to be had with the design. However, other challenges appeared in its place—the first being able to call individual elements from Chamber Master\'s API. Initial tests showed everything inside one string, which proved cumbersome for what we needed. The developers eventually devised a way to separate the elements into an array for us to cherry-pick from. Unfortunately, this led to our next problem—a set limit of 50 calls allowed to the API per day. This limitation, if left unwatched, could quickly be exhausted by one site visit. The team and I had to construct a schedule in which updates would automatically be applied to the website. A majority of these updates took place during business hours, while only a few happened outside that timeframe.');
INSERT INTO `wp_postmeta` VALUES (22040,224,'_section_6_blurb','field_5efd211f1626a');
