INSERT INTO `wp_postmeta` VALUES (22053,224,'section_9_blurb','<h2>Venture Into Advertisement</h2>\r\nGalveston Chamber was looking to broaden its revenue. In an internal meeting, they concluded opening the website for the display of advertisements was their best option. This was uncharted territory for both Galveston Chamber and I to traverse. Despite that, they still considered my expertise in the matter. For me to be their guide, I first had to educate myself.\r\n\r\n<strong>My thought process wasn\'t to reinvent the wheel.</strong> Instead, I wanted to <strong>follow a system advertisers were </strong><span class=\"css-1y6i96q-WordGridItemBox etbu2a32\"><strong>acquainted</strong> with. I ultimately took inspiration from Google as their ads trek vastly across the web, and their documentation elucidates its usage, increasing the likelihood of familiarity. This allowed me to grasp the concept and turn </span><span style=\"font-size: calc(var(--rem) * 1px * 1.0625); letter-spacing: 0px;\">around </span><span style=\"font-size: calc(var(--rem) * 1px * 1.0625); letter-spacing: 0px;\">the information towards Galveston Chamber quickly. <strong>Following Google as the standard enables ads to be prepared more swiftly</strong> compared to advertisers having to learn an anomalous process.</span>\r\n\r\n&nbsp;');
INSERT INTO `wp_postmeta` VALUES (22054,224,'_section_9_blurb','field_5efd211f1626a');
INSERT INTO `wp_postmeta` VALUES (22055,224,'section_10_images_w_caption_show_caption','0');
