INSERT INTO `wp_postmeta` VALUES (22060,224,'_section_10_images_w_caption','field_5efd33d559cce');
INSERT INTO `wp_postmeta` VALUES (22061,224,'section_11_blurb','<h2>Illustrating the History of Galveston</h2>\r\nGalveston Chamber\'s website is intended for more than just its members. It provides tourists and potential citizens an extensive virtual tour of the sights and sounds of Galveston Island.\r\n\r\nI worked closely with Galveston Chamber to obtain photos of the area. With the approval and assets provided by the Convention &amp; Visitors Bureau, we cataloged what represented Galveston the best. A lot of history was embedded on this island and still showed to this day in its architecture. At the same time, Galveston was ushering in the modern era with its development in the cruise ship industry and overall being a vacation destination hotspot. With these as a guide, we established a diverse portfolio of imagery to tell Galveston\'s tale scattered throughout the website.');
INSERT INTO `wp_postmeta` VALUES (22062,224,'_section_11_blurb','field_5efd211f1626a');
