INSERT INTO `wp_postmeta` VALUES (24232,230,'section_2_images_w_caption_caption','<h3>Abstract Disposition</h3>\r\n<strong>Each characteristic guides the user as much as it is reflective of the company\'s core values.</strong> To achieve this, <strong>I started with a path to progress users forward.</strong> Through that—depending on the circumstance—<strong>shapes, colors, and space played a role in invoking a feeling of integrity, collaboration, and commitment</strong> through elements that are transparent, conjoining, and highly-contrast amongst its siblings. Following these conditions allowed the design to <strong>develop a contemporary, sophisticated, sleek, and elegant feel</strong> in which the client was seeking.');
