INSERT INTO `wp_postmeta` VALUES (24240,230,'section_6_blurb','<h2>Tailored Tactically</h2>\r\nThe intended use of this site was to serve in an adjuvant capacity inside sales pitch meetings. While the team and I made this goal a reality for the client, we helped broaden their horizons by presenting the ability for it to function independently outside those meetings.\r\n\r\nTo start, a <strong>comprehensive framework of the onboarding processes and relatable business scenarios flourish throughout the website</strong>, helping to educate and build trust in Array Dental\'s capabilities. In conjunction, an <strong>RFI form is applied to the bottom of each page a user would prospect</strong> for information to encourage lead generation. These, in tandem, <strong>helped triple their clientele base</strong> allowing this newfound startup to expand its team and profits <strong>under six months after launch</strong>.');
