INSERT INTO `wp_postmeta` VALUES (28771,47,'section_3_blurb','<h2>User-centric Fusion</h2>\r\nUSA Bridal suffered from a lack of a centralized system. Preceding the redesign, they, and their users, were shuffling between multiple websites dividing their business. USA Bridal was aware of the extra steps this created but didn\'t know how to solve the problem. While the solution was proposed and signed off by others before me, it was my responsibility to figure out how to create that system.\r\n\r\n<strong>Focus first went into the story.</strong> Their audience needed to build a human connection initially through empathy. This presented a window to tackle another goal of theirs, which was to <strong>increase foot traffic through scheduled appointments.</strong> To encourage interest in their products, most <strong>images linked to a page selling that product</strong>, never letting users stray far from a potential sale.');
INSERT INTO `wp_postmeta` VALUES (28772,47,'_section_3_blurb','field_5efd211f1626a');
INSERT INTO `wp_postmeta` VALUES (28783,47,'section_6_images_w_caption_caption','<h3>Contempo Rebranding</h3>\r\nUSA Bridal\'s brand identity, while compelling in theory, appeared antiquated by its typographic choices and clip art like iconography. With no-holds-barred, I decided to reimagine this idea.\r\n\r\nIn line with the original vision, all elements remained in the same position. <strong>Focus went more towards adjusting the typography and the icon.</strong> The <strong>rotation of the icon allows it to rest naturally</strong> within the brand name. This removes the awkward nature of bastardizing the icon enforcing it to fit. The sudden <strong>change in height helps create a visual breakage</strong> giving the identity a unique shape. And, the shift <strong>color tones align more with industry expectations</strong> and a stronger attraction to their demographic.');
INSERT INTO `wp_postmeta` VALUES (28784,47,'_section_6_images_w_caption_caption','field_5efd33ea59cd0');
