INSERT INTO `wp_postmeta` VALUES (28813,47,'section_11_blurb','<h2>A Perpetual Navigation</h2>\r\nBetween the eCommerce and the sizable content, USA Bridal\'s <strong>navigation was inevitably going to be extensive</strong>. A possible solution that could house all of this would be a mega menu. But, by default, that could struggle to contain a myriad-like of collections and brands. This complication would potentially hinder their plans on future expansion as well. To counter this, <strong>I devoted more real estate to the navigation by veering towards going full screen</strong>. This blank canvas allows the website\'s navigation to morph and dilate in sync with their business.');
INSERT INTO `wp_postmeta` VALUES (28814,47,'_section_11_blurb','field_5efd211f1626a');
